import React from 'react';
import EmojiPicker from 'emoji-picker-react';

class Login extends React.Component {
    constructor() {
        super();
        this.state = {
            hideLogin: false
        };

        this.handleChange = this.handleChange.bind(this);
    }

    render() {
        const style = this.state.hideLogin ? { display: 'none' } : {};
        function emoji() { }


        return (
            <div className="messagingSend">
                <div id="send">
                    <textarea className="sendInput"></textarea>
                    <div className="submit"><span>Send</span></div>
                    <div className="emojiButton" onClick={this.handleChange}><img src="./icons/icons_alien.png" className="emojiButton" /> </div>
                </div>
                <EmojiPicker style={style} onEmojiClick={emoji()} />
            </div>
        )
    }
}
export default Login;
